function Question({ question }) {
  return (
    <div>
      <h4>{question.question}</h4>
      <div className="options">
        {question.map((question) => (
          <button key={question} className="btn btn-option">
            {question}
          </button>
        ))}
      </div>
    </div>
  );
}

export default Question;
